import { Modal } from 'antd';
import React from 'react';

const ModalDelete = ({ open, onCancel }) => {
    const handleDelete = async () => {
        console.log('Xóa bản ghi');
    };

    return (
        <Modal
            title="Xóa nhân viên"
            centered
            open={open}
            width={500}
            okText="Xác nhận"
            cancelText="Hủy"
            onCancel={onCancel}
            onOk={handleDelete}
            className="modal-delete"
        >
            <p>Bạn có chắc chắn muốn xóa?</p>
        </Modal>
    );
};

export default ModalDelete;
